import {Link} from "react-router-dom";

function Nav(){
    return(
        <div className="nav">

            <button><Link to='/'>Intro</Link></button>
            <li><Link to='/profile'>Profile</Link></li>
            <li><Link to='/idea'>Idea</Link></li>
            <li>< Link to='/capabilities'>Capabilities</Link></li>
        </div>
    )
}

export default Nav;
